import React from 'react'
import { Container } from 'react-bootstrap'

const Index = () => {

    return (
        <Container>
            <section>
                <h1>El calvo de la Loteria</h1>
                <iframe src="https://lotoluck.com:443//utils/buscador_boletos.php" width="240" height="310" scrolling="auto" frameborder="0"></iframe>
            </section>
        </Container>
    )
}

export default Index
